import Header from '../../components/Header';
import CadastrarPerguntas from '../../components/CadastrarPerguntas';

const Cadastrar = () => {
    return(
        <div className="Cadastrar">
            <header className="App-header">
                <Header />
            </header>

            <footer>
                <CadastrarPerguntas />
            </footer>
        </div>
    )

}

export default Cadastrar;
